Halcyon River Diaries Christmas Special

Nature Documentary hosted by Hugh Dennis, published by BBC in 2010 - English narration


Information
------------------------------

We join Charlie as he tracks his beloved otters with Gus, sets up an experiment with Fred to see how fast kingfishers actually fly, and tries to record the elusive winter song of a dipper. Philippa is busy re-homing twelve battery hens and making bird cakes with Arthur, until one day a predator strikes and her water vole colony are under threat - could the mink be back on the river?

